import React from 'react';

const PairingDashboard = ({ pairedStudents }) => {
  return (
    <div>
      <h2>Current Pairings</h2>
      <ul>
        {pairedStudents.map((pair, index) => (
          <li key={index}>
            {pair.student1} & {pair.student2}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default PairingDashboard;
